import { IPost } from "../types";

interface IProps {
  post: IPost
}

export function Post({ post }: IProps) {
  return (
    <tr className={` ${post.title === 'ID' ? 'w-1/5' : 'w-2/5'}`} >
      <th className="p-4 border border-[E3E6EC]">{post.id}</th>
      <td className="p-4 border ">{post.title}</td>
      <td className="p-4 border ">{post.body}</td>
    </tr>
  );
}
